import { DashAnchor,DashUl,DashLi } from "../components/styles";

const header = () =>{
    return(
        <div>
            <DashUl>
                <DashLi><DashAnchor to="#">Dashboard</DashAnchor></DashLi>
                <DashLi><DashAnchor to="/contact" >Contact</DashAnchor></DashLi>
                <DashLi><DashAnchor to="/aboutUs">About us</DashAnchor></DashLi>
            </DashUl>

        </div>
    )
}

export default header;
